import React from 'react'

const EditItem=(props)=>{
    
  const onEdit=()=>{
    props.setShifts(prev => prev.filter((item) => item.description !== props.shift.description))
  }

   return (
    <button onClick={onEdit}>Edit</button>
   )
}
export default EditItem;
